import React, { useState, useEffect } from 'react';
import MapView from './MapView';
import LocationService, { Location, LocationError } from '../services/locationService';
import PlacesService, { HealthcareProvider, SearchFilters } from '../services/placesService';
import './HealthcareSearch.css';

// Remove duplicate interfaces - using imports from services

interface SymptomAssessment {
  symptoms: string[];
  severity: 'mild' | 'moderate' | 'severe' | 'emergency';
  duration: string;
  description: string;
}

const HealthcareSearch: React.FC = () => {
  const [userLocation, setUserLocation] = useState<Location | null>(null);
  const [providers, setProviders] = useState<HealthcareProvider[]>([]);
  const [selectedProvider, setSelectedProvider] = useState<HealthcareProvider | null>(null);
  const [searchMode, setSearchMode] = useState<'location' | 'symptoms'>('location');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  // Search filters
  const [filters, setFilters] = useState<SearchFilters>({
    type: 'all',
    radius: 5,
    rating: 0,
    accessibility: false,
    insurance: 'all'
  });

  // Symptom assessment
  const [symptoms, setSymptoms] = useState<SymptomAssessment>({
    symptoms: [],
    severity: 'mild',
    duration: '',
    description: ''
  });

  useEffect(() => {
    getCurrentLocation();
  }, []);

  useEffect(() => {
    if (userLocation && searchMode === 'location') {
      searchNearbyProviders();
    }
  }, [userLocation, filters]); // eslint-disable-line react-hooks/exhaustive-deps

  const getCurrentLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setUserLocation({
            lat: position.coords.latitude,
            lng: position.coords.longitude
          });
        },
        (error) => {
          setError('Unable to get your location. Please search manually.');
          console.error('Geolocation error:', error);
        }
      );
    }
  };

  const searchNearbyProviders = async () => {
    if (!userLocation) return;

    setLoading(true);
    setError(null);

    try {
      // This will eventually call Zach's Databricks API
      // For now, we'll use Google Places API as a demo
      const response = await searchGooglePlaces(userLocation, filters);
      setProviders(response);
    } catch (err) {
      setError('Failed to search for healthcare providers');
      console.error('Search error:', err);
    } finally {
      setLoading(false);
    }
  };

  const searchGooglePlaces = async (location: Location, filters: SearchFilters): Promise<HealthcareProvider[]> => {
    // Demo implementation using Google Places API
    // This would be replaced with Zach's Databricks API

    const service = new google.maps.places.PlacesService(document.createElement('div'));

    return new Promise((resolve, reject) => {
      const request = {
        location: new google.maps.LatLng(location.lat, location.lng),
        radius: filters.radius * 1609.34, // Convert miles to meters
        type: getGooglePlaceType(filters.type)
      };

      service.nearbySearch(request, (results, status) => {
        if (status === google.maps.places.PlacesServiceStatus.OK && results) {
          const providers: HealthcareProvider[] = results.map((place, index) => ({
            id: place.place_id || `provider_${index}`,
            name: place.name || 'Unknown Provider',
            address: place.vicinity || 'Address not available',
            type: getProviderType(place.types || []),
            rating: place.rating,
            location: {
              lat: place.geometry?.location?.lat() || 0,
              lng: place.geometry?.location?.lng() || 0
            },
            distance: calculateDistance(location, {
              lat: place.geometry?.location?.lat() || 0,
              lng: place.geometry?.location?.lng() || 0
            })
          }));

          resolve(providers.filter(p => filters.rating === 0 || (p.rating && p.rating >= filters.rating)));
        } else {
          reject(new Error(`Places search failed: ${status}`));
        }
      });
    });
  };

  const getGooglePlaceType = (type: string): string => {
    switch (type) {
      case 'hospital': return 'hospital';
      case 'pharmacy': return 'pharmacy';
      case 'clinic': return 'doctor';
      case 'urgent_care': return 'hospital';
      default: return 'hospital';
    }
  };

  const getProviderType = (types: string[]): string => {
    if (types.includes('hospital')) return 'hospital';
    if (types.includes('pharmacy')) return 'pharmacy';
    if (types.includes('doctor')) return 'clinic';
    return 'healthcare';
  };

  const calculateDistance = (loc1: Location, loc2: Location): number => {
    const R = 3959; // Earth's radius in miles
    const dLat = (loc2.lat - loc1.lat) * Math.PI / 180;
    const dLng = (loc2.lng - loc1.lng) * Math.PI / 180;
    const a = Math.sin(dLat/2) * Math.sin(dLat/2) +
              Math.cos(loc1.lat * Math.PI / 180) * Math.cos(loc2.lat * Math.PI / 180) *
              Math.sin(dLng/2) * Math.sin(dLng/2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
    return R * c;
  };

  const handleSymptomSearch = async () => {
    setLoading(true);
    setError(null);
    setSearchMode('symptoms');

    try {
      // This will call Zach's LLM API for symptom analysis
      const analysis = await analyzeSymptoms(symptoms);

      // Search for providers based on recommended care type
      if (userLocation) {
        const recommendedFilters = {
          ...filters,
          type: analysis.recommendedCareType
        };
        const response = await searchGooglePlaces(userLocation, recommendedFilters);
        setProviders(response);
      }
    } catch (err) {
      setError('Failed to analyze symptoms');
      console.error('Symptom analysis error:', err);
    } finally {
      setLoading(false);
    }
  };

  const analyzeSymptoms = async (symptoms: SymptomAssessment): Promise<{
    recommendedCareType: string;
    urgency: string;
    recommendations: string;
  }> => {
    // Placeholder for Zach's LLM API call
    // This would send symptoms to Databricks endpoint for analysis

    return new Promise((resolve) => {
      setTimeout(() => {
        let recommendedCareType = 'clinic';

        if (symptoms.severity === 'emergency') {
          recommendedCareType = 'hospital';
        } else if (symptoms.severity === 'severe') {
          recommendedCareType = 'urgent_care';
        } else if (symptoms.symptoms.some(s => s.toLowerCase().includes('pharmacy'))) {
          recommendedCareType = 'pharmacy';
        }

        resolve({
          recommendedCareType,
          urgency: symptoms.severity,
          recommendations: `Based on your symptoms, we recommend visiting a ${recommendedCareType}.`
        });
      }, 1000);
    });
  };

  const handleLocationChange = (location: Location) => {
    setUserLocation(location);
  };

  const handleProviderSelect = (provider: HealthcareProvider) => {
    setSelectedProvider(provider);
  };

  const addSymptom = (symptom: string) => {
    if (symptom && !symptoms.symptoms.includes(symptom)) {
      setSymptoms(prev => ({
        ...prev,
        symptoms: [...prev.symptoms, symptom]
      }));
    }
  };

  const removeSymptom = (symptom: string) => {
    setSymptoms(prev => ({
      ...prev,
      symptoms: prev.symptoms.filter(s => s !== symptom)
    }));
  };

  return (
    <div className="healthcare-search">
      <div className="search-header">
        <h2>Find Healthcare Providers</h2>
        <div className="search-mode-toggle">
          <button 
            className={`mode-btn ${searchMode === 'location' ? 'active' : ''}`}
            onClick={() => setSearchMode('location')}
          >
            üìç Location Search
          </button>
          <button 
            className={`mode-btn ${searchMode === 'symptoms' ? 'active' : ''}`}
            onClick={() => setSearchMode('symptoms')}
          >
            ü©∫ Symptom Checker
          </button>
        </div>
      </div>

      <div className="search-content">
        <div className="search-panel">
          {searchMode === 'location' ? (
            <div className="location-search">
              <div className="search-filters">
                <h3>Search Filters</h3>

                <div className="filter-group">
                  <label>Provider Type:</label>
                  <select 
                    value={filters.type} 
                    onChange={(e) => setFilters({...filters, type: e.target.value})}
                  >
                    <option value="all">All Types</option>
                    <option value="hospital">Hospitals</option>
                    <option value="urgent_care">Urgent Care</option>
                    <option value="clinic">Clinics</option>
                    <option value="pharmacy">Pharmacies</option>
                  </select>
                </div>

                <div className="filter-group">
                  <label>Radius: {filters.radius} miles</label>
                  <input 
                    type="range" 
                    min="1" 
                    max="25" 
                    value={filters.radius}
                    onChange={(e) => setFilters({...filters, radius: Number(e.target.value)})}
                  />
                </div>

                <div className="filter-group">
                  <label>Minimum Rating:</label>
                  <select 
                    value={filters.rating} 
                    onChange={(e) => setFilters({...filters, rating: Number(e.target.value)})}
                  >
                    <option value="0">Any Rating</option>
                    <option value="3">3+ Stars</option>
                    <option value="4">4+ Stars</option>
                    <option value="4.5">4.5+ Stars</option>
                  </select>
                </div>

                <div className="filter-group">
                  <label>
                    <input 
                      type="checkbox" 
                      checked={filters.accessibility}
                      onChange={(e) => setFilters({...filters, accessibility: e.target.checked})}
                    />
                    Wheelchair Accessible
                  </label>
                </div>
              </div>
            </div>
          ) : (
            <div className="symptom-search">
              <h3>Describe Your Symptoms</h3>

              <div className="symptom-input">
                <div className="common-symptoms">
                  <h4>Common Symptoms:</h4>
                  <div className="symptom-buttons">
                    {['Headache', 'Fever', 'Cough', 'Sore Throat', 'Nausea', 'Chest Pain', 'Shortness of Breath'].map(symptom => (
                      <button 
                        key={symptom}
                        className={`symptom-btn ${symptoms.symptoms.includes(symptom) ? 'selected' : ''}`}
                        onClick={() => symptoms.symptoms.includes(symptom) ? removeSymptom(symptom) : addSymptom(symptom)}
                      >
                        {symptom}
                      </button>
                    ))}
                  </div>
                </div>

                <div className="selected-symptoms">
                  <h4>Your Symptoms:</h4>
                  <div className="symptom-tags">
                    {symptoms.symptoms.map(symptom => (
                      <span key={symptom} className="symptom-tag">
                        {symptom}
                        <button onClick={() => removeSymptom(symptom)}>√ó</button>
                      </span>
                    ))}
                  </div>
                </div>

                <div className="symptom-details">
                  <div className="detail-group">
                    <label>Severity:</label>
                    <select 
                      value={symptoms.severity}
                      onChange={(e) => setSymptoms({...symptoms, severity: e.target.value as any})}
                    >
                      <option value="mild">Mild</option>
                      <option value="moderate">Moderate</option>
                      <option value="severe">Severe</option>
                      <option value="emergency">Emergency</option>
                    </select>
                  </div>

                  <div className="detail-group">
                    <label>Duration:</label>
                    <input 
                      type="text" 
                      placeholder="e.g., 2 days, 1 week"
                      value={symptoms.duration}
                      onChange={(e) => setSymptoms({...symptoms, duration: e.target.value})}
                    />
                  </div>

                  <div className="detail-group">
                    <label>Additional Details:</label>
                    <textarea 
                      placeholder="Describe any additional symptoms or context..."
                      value={symptoms.description}
                      onChange={(e) => setSymptoms({...symptoms, description: e.target.value})}
                      rows={3}
                    />
                  </div>
                </div>

                <button 
                  className="analyze-btn"
                  onClick={handleSymptomSearch}
                  disabled={symptoms.symptoms.length === 0 || loading}
                >
                  {loading ? 'Analyzing...' : 'Get Recommendations'}
                </button>
              </div>
            </div>
          )}

          {error && (
            <div className="error-message">
              <p>{error}</p>
            </div>
          )}
        </div>

        <div className="map-section">
          <MapView 
            userLocation={userLocation}
            providers={providers}
            onLocationChange={handleLocationChange}
            onProviderSelect={handleProviderSelect}
          />
        </div>
      </div>

      {providers.length > 0 && (
        <div className="results-section">
          <h3>Healthcare Providers ({providers.length} found)</h3>
          <div className="provider-list">
            {providers.map(provider => (
              <div 
                key={provider.id} 
                className={`provider-card ${selectedProvider?.id === provider.id ? 'selected' : ''}`}
                onClick={() => handleProviderSelect(provider)}
              >
                <div className="provider-header">
                  <h4>{provider.name}</h4>
                  <span className={`provider-type ${provider.type}`}>
                    {provider.type.replace('_', ' ')}
                  </span>
                </div>
                <p className="provider-address">{provider.address}</p>
                {provider.rating && (
                  <div className="provider-rating">
                    {'‚≠ê'.repeat(Math.round(provider.rating))} {provider.rating.toFixed(1)}
                  </div>
                )}
                {provider.distance && (
                  <p className="provider-distance">{provider.distance.toFixed(1)} miles away</p>
                )}
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default HealthcareSearch;
